function presentar_ensamblador(resultado) {

  var ventana_resultado = window.open();

  ventana_resultado.document.open();
  ventana_resultado.document.write(resultado);
  ventana_resultado.document.close();
}

function leer_fichero_ensamblador(fichero_ensamblador)
{
  var reader = new FileReader();

  reader.addEventListener("load", function () {
    document.getElementById('ensamblador').value = reader.result;
  }, false);

  reader.readAsText(fichero_ensamblador.files[0]);
}

<table>

b:      .double 2

s2:     .space 8
